import React from "react";
import { Link } from "react-router-dom";
import {
  MDBDropdown,
  MDBDropdownMenu,
  MDBDropdownToggle,
  MDBDropdownItem,
} from "mdb-react-ui-kit";
import "./navi.css";

export default class Navi extends React.Component {
  render() {
    return (
      <>
        <header>
          <div className="container flex">
            <div className="logo">
              <img src="./images/logo.png" alt="" />
            </div>
            <div className="nav">
              <ul>
                <li>
                  <Link to={"/kiracilar"}>Kiracılar</Link>
                </li>
                <li>
                  <Link to={"/homes"}>Evler</Link>
                </li>
              </ul>
            </div>
            <div className="button flex">
              <h4>
                <span>2</span> Listem
              </h4>
              {/* 
            <button className='btn1'>
              <i className='fa fa-sign-out'></i> Çıkış Yap
            </button> */}
              <MDBDropdown>
                <MDBDropdownToggle color="succes">Kullanıcı</MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem link href="/login">
                    Profil
                  </MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </div>

            {/* <div className="toggle">
              <button onClick={() => setNavList(!navList)}>
                {navList ? (
                  <i className="fa fa-times"></i>
                ) : (
                  <i className="fa fa-bars"></i>
                )}
              </button>
            </div> */}
          </div>
        </header>
      </>
    );
  }
}
